[include mmu/base/*.cfg]
[include mmu/optional/client_macros.cfg]

## Uncomment for input shaping via USB
#
#[include metis_config/adxl.cfg]

## Include other config files
[include metis_config/stealthburner.cfg]
[include metis_config/variables.cfg]
[include shell_command.cfg]
[include macros/*.cfg]
[include KAMP_Settings.cfg]
[include K-ShakeTune/*.cfg]

#####################################################################
#  Danger! Danger! High Voltage!
#####################################################################

#[danger_options]
#multi_mcu_trsync_timeout: 0.05


#####################################################################
#  Misc
#####################################################################

[printer]
kinematics: corexy
max_velocity: 450  
max_accel: 10000
max_z_velocity: 25          #Max 15 for 12V TMC Drivers, can increase for 24V
max_z_accel: 75
square_corner_velocity: 8.0
minimum_cruise_ratio: 0.5

[virtual_sdcard]
path: ~/printer_data/gcodes
on_error_gcode: CANCEL_PRINT

[display_status]

[respond]

[pause_resume]

[save_variables]
filename: ~/printer_data/config/saved_variables.cfg

[exclude_object]

# Enable arcs support
[gcode_arcs]
resolution: 0.1

#[firmware_retraction]
#retract_length: 0.5
#   The length of filament (in mm) to retract when G10 is activated,
#   and to unretract when G11 is activated (but see
#   unretract_extra_length below). The default is 0 mm.
#retract_speed: 40
#   The speed of retraction, in mm/s. The default is 20 mm/s.
#unretract_extra_length: 0
#   The length (in mm) of *additional* filament to add when
#   unretracting.
#unretract_speed: 40
#   The speed of unretraction, in mm/s. The default is 10 mm/s.
#z_hop_height: 0.0
#   The vertical height by which the nozzle is lifted from the print to
#   prevent collisions with the print during travel moves when retracted.
#   The minimum value is 0 mm, the default value is 0 mm, which disables
#   zhop moves.

#####################################################################
#  Controllers
#####################################################################
[mcu]
serial: /dev/serial/by-id/usb-Klipper_stm32h723xx_290009000B51313236343430-if00

restart_method: command

[mcu nhk]
##  Obtain definition by "ls -l /dev/serial/by-id/" then unplug to verify
##--------------------------------------------------------------------
serial: /dev/serial/by-id/usb-Klipper_rp2040_E6626005A74F4436-if00
restart_method: command
##--------------------------------------------------------------------

#[mcu rpi]
#serial: /tmp/klipper_host_mcu


#####################################################################
#   Probe
#####################################################################

[beacon]
serial: /dev/serial/by-id/usb-Beacon_Beacon_RevH_B039CAA54E5737374D202020FF0A092A-if00  
x_offset: 0 # update with offset from nozzle on your machine
y_offset: 25 # update with offset from nozzle on your machine
mesh_main_direction: x
mesh_runs: 2
accel_axes_map: -x, -y, z
#is_non_critical: True


[bed_mesh]
speed: 425
zero_reference_position: 147.5, 125
horizontal_move_z: 3
mesh_min: 20,25
mesh_max: 275,270
probe_count: 40,40
algorithm: bicubic
fade_start: 0.6
fade_end: 10
move_check_distance: 3
split_delta_z: 0.01
mesh_pps: 0
bicubic_tension: 0.2
#   When using the bicubic algorithm the tension parameter above
#   may be applied to change the amount of slope interpolated.
#   Larger numbers will increase the amount of slope, which
#   results in more curvature in the mesh. Default is .2.

[safe_z_home]
home_xy_position: 147.5, 125
#   A X, Y coordinate (e.g. 100, 100) where the Z homing should be
#   performed. This parameter must be provided.
speed: 100.0
#   Speed at which the toolhead is moved to the safe Z home
#   coordinate. The default is 50 mm/s
z_hop: 10
z_hop_speed: 10


[input_shaper]
shaper_freq_x: 65.2
shaper_freq_y: 54.8
shaper_type: ei
damping_ratio_x: 0.089
damping_ratio_y: 0.042


#####################################################################
#   Fan Control
#####################################################################

[fan]
pin: nhk:gpio6
off_below: 0.05
#cycle_time: 0.1
kick_start_time: 0.2

[heater_fan hotend_fan]
pin: nhk:gpio5
#max_power: 1.0
#cycle_time: 0.2
#kick_start_time: 0.5
heater: extruder
heater_temp: 50.0

[controller_fan casefan1]
pin: PA1
tachometer_pin:PC3
kick_start_time: 0.5
heater: heater_bed
fan_speed: 1


[controller_fan casefan2]
pin: PF8
tachometer_pin:PC1
kick_start_time: 0.5
heater: heater_bed
fan_speed: 1

[fan_generic nevermore]
pin: PA6
#cycle_time: 0.05
kick_start_time: 0.5

[fan_generic runcounter]
pin: PA3


#####################################################################
#   Bed Heater
#####################################################################

[heater_bed]
##  SSR Pin - HE1
##  Thermistor - TB
heater_pin: PF5
sensor_type: Generic 3950
sensor_pin: PB1
max_power: 0.8
min_temp: 0
max_temp: 120

#####################################################################
#   TMC Autotune
#####################################################################
[autotune_tmc extruder]
motor: ldo-36sth20-1004ahg-9T

[autotune_tmc stepper_x]
motor: omc-17hs19-2504s-h
[autotune_tmc stepper_y]
motor: omc-17hs19-2504s-h

[autotune_tmc stepper_z]
motor: ldo-42sth48-2004ac
[autotune_tmc stepper_z1]
motor: ldo-42sth48-2004ac
[autotune_tmc stepper_z2]
motor: ldo-42sth48-2004ac
[autotune_tmc stepper_z3]
motor: ldo-42sth48-2004ac



#####################################################################
#   Extruder
#####################################################################


##LDO 36mm Pancake 1.8 LDO-36STH20-1004AHG(9T)
[extruder]
step_pin: nhk:gpio23
dir_pin: nhk:gpio24
enable_pin: !nhk:gpio25
rotation_distance: 48.02976
gear_ratio: 9:1
microsteps: 16
full_steps_per_rotation: 200 #1.8deg Motor
nozzle_diameter: 0.400
filament_diameter: 1.75
heater_pin: nhk:gpio9
sensor_type: ATC Semitec 104NT-4-R025H42G
sensor_pin: nhk:gpio29
pullup_resistor: 2200
min_temp: 0
max_temp: 300
max_power: 1.0
min_extrude_temp: 170
max_extrude_only_distance: 200
max_extrude_cross_section: 50
pressure_advance: 0.03
pressure_advance_smooth_time: 0.04
#pressure_advance_model: linear

[tmc2209 extruder]
uart_pin: nhk:gpio0
tx_pin: nhk:gpio1
interpolate: true
#stealthchop_threshold: 0
sense_resistor: 0.110
run_current: 0.6
#driver_TBL: 1
#driver_TOFF: 3 # 45.5Khz max chopper frequency
#driver_HSTRT: 7
#driver_HEND: 7

#####################################################################
#   X/Y Stepper Settings
#####################################################################

##  B Stepper - Left
##  Connected to MOTOR1


[stepper_x]
step_pin: PC13
dir_pin: !PC14
enable_pin: !PE6
rotation_distance: 40
microsteps: 16
full_steps_per_rotation: 200  #400 for 0.9 200 for 1.8
endstop_pin: nhk:gpio10
homing_speed: 60
second_homing_speed: 25
homing_retract_dist: 5
position_min: 0
position_endstop: 290   
position_max: 290
homing_positive_dir: true
homing_retract_dist: 0
#use_sensorless_homing: false

[tmc2209 stepper_x]
uart_pin: PG14
interpolate: true
#stealthchop_threshold: 0
sense_resistor: 0.110
## OMC 48mm 1.8 17HS19-2504S-H = 1.1Ohm 1.6mH
run_current: 0.8


##  A Stepper - Right
##  Connected to MOTOR2
##  Endstop connected to PC15
[stepper_y]
step_pin: PE4
dir_pin: !PE5
enable_pin: !PE3
rotation_distance: 40
microsteps: 16
full_steps_per_rotation: 200   #400 for 0.9 200 for 1.8
endstop_pin: PC15
homing_speed: 60
second_homing_speed: 25
homing_retract_dist: 5
position_min: 0
position_endstop: 305
position_max: 305
homing_positive_dir: true
homing_retract_dist: 0
#use_sensorless_homing: false



[tmc2209 stepper_y]
uart_pin: PG13
interpolate: true
sense_resistor: 0.110
#stealthchop_threshold: 0
## OMC 48mm 1.8 17HS19-2504S-H = 1.1Ohm 1.6mH
run_current: 0.8


 
#####################################################################
#   Z Stepper Settings
#####################################################################

## Z0 Stepper - Front Left
##  Connected to 4
##  Endstop connected to probe:z_virtual_endstop
[stepper_z]
step_pin: PB8
dir_pin: !PB9
enable_pin: !PB7
rotation_distance: 40
gear_ratio: 80:16
microsteps: 32
endstop_pin: probe:z_virtual_endstop
position_max: 210
position_min: -5
homing_retract_dist: 0
homing_speed: 25

[tmc2209 stepper_z]
uart_pin: PG11
interpolate: true
sense_resistor: 0.110
stealthchop_threshold: 999999
## LDO Stepper Motor (42STH48-2004AC) = 1.6 Ohm 3mH
run_current: 0.707



##  Z1 Stepper - Rear Left
##  Connected to MOTOR5
[stepper_z1]
step_pin: PB5
dir_pin: PB4
enable_pin: !PB6
rotation_distance: 40
gear_ratio: 80:16
microsteps: 32

[tmc2209 stepper_z1]
uart_pin: PG10
interpolate: true
sense_resistor: 0.110
stealthchop_threshold: 999999
## LDO Stepper Motor (42STH48-2004AC) = 1.6 Ohm 3mH
run_current: 0.707



##  Z2 Stepper - Rear Right
##  Connected to MOTOR6
[stepper_z2]
step_pin: PG15
dir_pin: !PB3
enable_pin: !PD5
rotation_distance: 40
gear_ratio: 80:16
microsteps: 32

[tmc2209 stepper_z2]
uart_pin: PG9
interpolate: true
sense_resistor: 0.110
stealthchop_threshold: 999999
## LDO Stepper Motor (42STH48-2004AC) = 1.6 Ohm 3mH
run_current: 0.707



##  Z3 Stepper - Front Right
##  Connected to MOTOR7
[stepper_z3]
step_pin: PD3
dir_pin: PD2
enable_pin: !PD4
rotation_distance: 40
gear_ratio: 80:16
microsteps: 32

[tmc2209 stepper_z3]
uart_pin: PD7
interpolate: true
sense_resistor: 0.110
stealthchop_threshold: 999999
## LDO Stepper Motor (42STH48-2004AC) = 1.6 Ohm 3mH
run_current: 0.707


#####################################################################
# 	Homing and Gantry Adjustment Routines
#####################################################################

[idle_timeout]
timeout: 1800

[quad_gantry_level]
##  Gantry Corners for 300mm Build
##  Uncomment for 300mm build

gantry_corners:
   -60,-10
   360,370

##  Probe points
points:
   25,5
   25,245
   275,245
   275,5
   
speed: 450
horizontal_move_z: 5
retries: 5
retry_tolerance: 0.01
max_adjust: 20

#####################################################################
#   Additional Sensors
#####################################################################

[temperature_sensor chamber]
sensor_type: Generic 3950
sensor_pin: PC5
#min_temp: -40
#max_temp: 100
gcode_id: chamber_th

[temperature_sensor Octopus]
sensor_type: temperature_mcu
min_temp: -40
max_temp: 100

[temperature_sensor raspberry_pi]
sensor_type: temperature_host
min_temp: -40
max_temp: 110

[thermistor CMFB103F3950FANT]
temperature1: 0.0
resistance1: 32116.0
temperature2: 40.0
resistance2: 5309.0
temperature3: 80.0
resistance3: 1228.0

[temperature_sensor nh_temp]
## Nitehawk PCB Sensor
sensor_type: CMFB103F3950FANT
sensor_pin: nhk:gpio26
pullup_resistor: 2200
min_temp: 0
max_temp: 100
gcode_id: toolhead_th



#####################################################################
#   Gyroid Tweaks
#####################################################################

[gcode_macro _USE_INFILL_SQV]
gcode:
    {% set svv = printer.save_variables.variables %}
    {% set sqv = svv.infill_sqv | default(printer.configfile.settings.printer.square_corner_velocity, true) %}
    SET_VELOCITY_LIMIT SQUARE_CORNER_VELOCITY={ sqv }

[gcode_macro _USE_NORMAL_SQV]
gcode:
    {% set sqv = printer.configfile.settings.printer.square_corner_velocity %}
    SET_VELOCITY_LIMIT SQUARE_CORNER_VELOCITY={ sqv }

[gcode_macro SET_INFILL_SQV]
gcode:
    {% set svv = printer.save_variables.variables %}
    {% set val = params.SQV|default(svv.infill_sqv|default(printer.configfile.settings.printer.square_corner_velocity, true), true) | int %}
    SAVE_VARIABLE VARIABLE=infill_sqv VALUE={val}

